import React, { Component } from "react";
import { Link } from "react-router-dom";
import PropTypes from "prop-types";
import { connect } from "react-redux";
class IngredientItem extends Component {
  render() {
    const { ingredient } = this.props;
    return (
      <tr className="even pointer">
        <td className="a-center ">{ingredients.name}</td>
        <td className="a-center ">{ingredients.quantity}</td>
        <td className="a-center ">{ingredients.price}</td>
        <td className="a-center ">{ingredients.stock}</td>
        <td></td>
      </tr>
    );
  }
}

IngredientItem.propTypes = {
  deleteIngredient: PropTypes.func.isRequired,
};

export default connect(null, {})(IngredientItem);
